import React from "react";
import { View, Text } from "react-native";

function ViewCart(props) {
  return (
    <View>
      <TouchableOpacity>
        <Text style={{ color: "white", fontSize: 20 }}>View Cart</Text>
      </TouchableOpacity>
    </View>
  );
}

export default ViewCart;
